Samuel George &quot;Sammy&quot; Davis, Jr. (December 8, 1925 - May 16, 1990) was an American entertainer. He was a dancer, singer, multi-instrumentalist (vibraphone, trumpet, and drums), impressionist, comedian, convert to Judaism, and Emmy and Golden Globe-winning actor. He was a member of the 1960s Rat Pack, which was led by his old friend Frank Sinatra, and included fellow performers Dean Martin, Joey Bishop and Peter Lawford.

For much more info: http://en.wikipedia.org/wiki/Sammy_Davis_Jr.

